import React from "react";
import "./Form.css";

const Form=()=>{

    const formHandler=()=>{
        return;
    }

    return(
        <React.Fragment>
    <div className="wrapper">
  <div className="title">
    <h1>Add new Course</h1>
  </div>
  <div className="drive-form">
    <div className="input-fields">
      <input type="text" className="input" id="title" placeholder="title"/>
      <input type="text" className="input" id="type" placeholder="type (Aptitude/Technical/HR)"/>
      <input type="text" className="input" id="short" placeholder="Short description"/>
      <input type="text" className="input" id="long" placeholder="Additional description"/>

    </div>
    <div className="msg">
      <textarea style={{"border":"solid 1px white"}} placeholder="Description"></textarea>
      <div className="btn" onClick={formHandler}>send</div>
    </div>
  </div>
</div>
</React.Fragment>);
}

export default Form;
